import React, { Component } from 'react';
import Nav from '../assigned/nav';

class Home extends Component {
    constructor(props){
        super(props)
        this.username = this.props.uName;
        this.imageFile = this.props.imageFile;
    }



    render() {
        return (
            <div>
                <Nav username = {this.username} imageFile = {this.imageFile[0]} />

            </div>
        );
    }
}

export default Home;
